{"title":"github_pull_requests_efficiency_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel focuses on **closed** GitHub pull requests.

**REI**: Review Efficiency Index, defined as the number of closed pull requests divided by the number of open ones in a given period of time. Measures efficiency closing pull requests.

**Lead time**: the time expressed in days between the initiation and completion of a production process, in this case, a pull request. Shown in average."},"aggs":[]}
